// This is the function that you want to use. It expects as input a sql dump like the one that was provided to us.
fn csv_from_inserts(sql_inserts: &str) -> String {
    let connection = Connection::open_in_memory().unwrap();
    connection.execute(TABLE_SQL, ()).unwrap();
    // sqlite complains with this syntax
    let sql_inserts = sql_inserts.replace("IGNORE INTO", "INTO");
    connection.execute(&sql_inserts, ()).unwrap();
        
    let mut stmt =
        connection.prepare("SELECT * FROM voter_demo").unwrap();

    let rows = stmt.query_map([], |row| {
        let row = VoterRow::from_row(row).unwrap();
        let decrypted_row = row.decrypt();
        Ok(CsvRow::from_voter_row(decrypted_row))
    }).unwrap();

    let mut wtr = csv::Writer::from_writer(vec![]);
    for row in rows {
        wtr.serialize(row.unwrap()).unwrap();
    }
    wtr.flush().unwrap();
    
    String::from_utf8(wtr.into_inner().unwrap()).unwrap()
}

fn decrypt_string(encrypted_b64: Option<String>) -> Option<String> {
    if let Some(encrypted_b64) = encrypted_b64 {
        let bytes = STANDARD.decode(encrypted_b64).unwrap();
        let ret = if bytes.len() > 0 {
            let r = RijndaelCbc::<Pkcs7Padding>::new(KEY, 32).unwrap();

            let decrypted_result = r.decrypt(IV, bytes).unwrap();
            let decoded = String::from_utf8(decrypted_result).unwrap();    
            decoded.trim_matches(char::from(0)).to_string()
        }
        else {
            "".to_string()
        };

        Some(ret)
    }
    else {
        None
    }
}

